23.png\",\"nflByeWeek\":10,\"news\":[{\"timeEpochMilli\":\"1606098836000\",\"contents\":\"Lamb caught four of six targets for 34 yards and a touchdown in Sunday's 31-28 win over the Vikings. He also gained 12 rushing yards on two carries and ran in a two-point conversion.\",\"analysis\":\"While the rookie didn't gain much real estate, Lamb grabbed his fourth TD of the season in the second quarter on a four-yard toss from Andy Dalton. The entire Cowboys offense looked much improved after the team's bye with Dalton back under center, and as a result Lamb's fantasy fortunes are on the upswing again heading into a Thanksgiving clash with Washington.\",\"title\":\"TD grab in win over Vikings\"},{\"timeEpochMilli\":\"1606092569000\",\"contents\":\"Dallas Cowboys rookie wide receiver CeeDee Lamb scored a touchdown in a Week 11 win over the Minnesota Vikings. Lamb was targeted six times, catching four passes for 34 yards and a score. He added two carries for 12 yards and also scored a two-point conversion. Lamb didn't make any huge plays in terms of yardage, but his touchdown came on an outstanding catch in the second quarter. With Andy Dalton seemingly able to make the Cowboys look like a real NFL offense, Lamb should be back in the WR3 ...\",\"url\":\"https://www.rotoballer.com/player-news/ceedee-lamb-scores-in-a-week-11-victory/806897\",\"title\":\"CeeDee Lamb Scores In A Week 11 Victory\"}],\"isRookie\":true,\"nameFirst\":\"CeeDee\",\"nameLast\":\"Lamb\",\"proTeam\":{\"abbreviation\":\"DAL\",\"location\":\"Dallas\",\"name\":\"Cowboys\"},\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6309,\"away\":{\"abbreviation\":\"DAL\",\"location\":\"Dallas\",\"name\":\"Cowboys\"},\"home\":{\"abbreviation\":\"MIN\",\"location\":\"Minnesota\",\"name\":\"Vikings\"},\"startTimeEpochMilli\":\"1606080300000\",\"status\":\"FINAL_SCORE\",\"awayScore\":31,\"homeScore\":28,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":